import React from "react";
import "./SetUpAccount.scss";

export default function SetUpAccount({preview , showPreview , removePreview}) {
  return (
    <div className="setup">
      <form method="post" className="form">
        <label forhtml="fullName">Full Name: </label>
        <input type="text" name="fullName"></input>
        <br /> <br />
        <label forhtml="fullName">username: </label>
        <input type="text" name="fullName"></input>
        <br /> <br />
        {preview ? (<div className="image"> <img src={URL.createObjectURL(preview)} className="img" alt="profile-pic" /></div>) : null}
        <input
          type="file"
          className="file-ip"
          accept="image/*"
          onChange={showPreview}
        ></input>
      </form>
    </div>
  );
}
